      // Fetch API data from DB hosted on Render.
      try{
        const response = axios.get('https://blogapp-backend-15kn.onrender.com/api/workouts')
        .then((response) => {
          (setWorkouts(response.data));
        });
      }

      catch (error) {
          console.log("Failed to get blog", error)
      }
    }

    //call function
    fetchWorkouts()
  }, 

